import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Table(props) {
  console.log(props.getData)
  return (
    <div>    
    {
      props.getData.map((task)=>
        <div className="each-task">

            {task.name}            

        </div>
       )
    }   
    </div>
  );
}

export default Table;
